import React from "react";

import { connect } from "react-redux";
import { removeAddress } from "../../redux/address/address.action";

import "./address-card.styles.css";

const AddressCard = ({ address, removeAddress }) => {
  const { name, phone, nameStreet, numberStreet, city, zipCode } = address;
  console.log("ADREES CARD", name);
  return (
    <div className="addressCard__container">
      <div className="addressCard__subContainer">
        <hr />
        <strong>{name}</strong>
        <div className="addressCard__row">
          <span>{nameStreet}</span>
          <span>{numberStreet}</span>
        </div>

        <div className="addressCard__row">
          <span>{city}</span>
          <span>{}</span>
          <span>{zipCode}</span>
        </div>

        <span>{}</span>
        <span>{phone}</span>
        <button>Delivery this address</button>

        <button onClick={() => removeAddress()}>Remove</button>
        <hr />
      </div>
    </div>
  );
};

const mapStateToProps = (state) => ({
  address: state.address,
});

const mapDispatchToProps = (dispatch) => ({
  removeAddress: () => dispatch(removeAddress()),
});

export default connect(mapStateToProps, mapDispatchToProps)(AddressCard);
